function [S IDX varargout] = sphericalgrid4
%SPERICALGRID4 - Defines the spherical grid defined by 4 fold quadrisection
%of the isocahedron, or 16 fold tesselation of icosahedron
%
%NOTES: This sampling distribution is recommended by default
%
%OUTPUTS
%    S - coordinates for spherical grid in polar coordinates,  extends slightly
%    over one half of the sphere to estimate local maxima on border
%
%    IDX - first column defines points in S over one half of the sphere for
%    candiate local maxima. Columns 2-7 define the neighbors for the
%    corresponding point in column 1
%
%    IDX8 - defines vertices to undersample for sphericalgrid3 - this is useful,
%    for example, when trying to save a smaler datastructure to load into DSI
%    studio (all coordinates are savesd in one large file)
%
%    AREA - defines the area that each vertex 'encompasses.'it is generally 
%    impossible to spread points out isotropically over a sphere, so the area
%    is slightly different for each point - this can be used to update
%    computations that occure over the spherical grid, eg GFA
%
%    ODF_FACES - Data structure matching S to save and load into DSI Studio for
%    visualization. 
%
%    SEPARATION_ANGLE = average saparation angle
%
%Average separation angle between each peak and its nearest neighbors is
%4.33 (+\- 0.28) degrees
%
%Author: Russell Glenn
%Medical University of South Carolina 




